import React from 'react';
import {addpost, typePostInfo} from "../../../data/ProfileReduser";
import MyPosts from "./MyPosts";
import {connect} from "react-redux";



class MyPostsConteiner extends React.Component {
    componentDidMount() {

    }

    render() {

        return (
            <MyPosts post={this.props.posts} />
        )
    }
}
let StateProps = (state) =>({posts:state.ProfileData.Posts})

export default  connect(StateProps,{addpost,typePostInfo})(MyPostsConteiner)
